import React, { useState, useEffect } from 'react';

const SubNavChildNav = (props) => {
	const { subs, type } = props.subItems;
	return (
		<div>
			{subs.map((sub) =>
				sub.galleries.length > 1 ? <div>more than 1</div> : <div>1</div>
			)}
		</div>
	);
};

export default SubNavChildNav;
